import logo from '../images/logo.svg';
function Header(props) {
  
  return (
    <div className='main-header-container'>
      <div className="header-container">
        <div className="logo-container">
          <img src={logo} alt="logo" />
        </div>
      </div>    
    </div>
  )
}
export default Header;
